import React from 'react';
import { Link } from 'react-router-dom'
import IconPlanify from '../assets/logo.png'

function Dashboard(){
    return(
        <div>
            <Link to ='/beranda'>
                <img alt="icon-planify" src={IconPlanify} className="w-32" />
            </Link>
        </div>
    );
}

export default Dashboard;
